import React from "react";

import { NavLink } from "react-router-dom";
import Grid from "@material-ui/core/Grid";
import Button from "@material-ui/core/Button";
import video404 from "../images/404.mp4";




function Page404 (props) {

  return (
    <div className="notFoundContainer">

      <Button
        variant="contained"
        color="secondary"
        onClick={props.clearRandoms}
      >
        <NavLink exact to="/">
          BACK TO HOMEPAGE
        </NavLink>
      </Button>
      <video className="video-container video-container-overlay" autoPlay="true" loop muted={ this.props.muted }>
                    <source src={ this.props.introVideo } type="video/mp4" />
                </video>
    </div>
  )}


export default Page404;
